"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[6562],{32470:(t,e,r)=>{r.r(e),r.d(e,{default:()=>a,johnChapter11PL:()=>n});const n={chapter:11,title:"Jean 11",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"I by\u0142 niekt\xf3ry chory, \u0141azarz z Betanii, z miasteczka Maryi i Marty, siostry jej.",strong:[{text:"homme",strong:"G444",start:14,end:19},{text:"malade",strong:"G772",start:20,end:26}]},{number:2,text:"(A ta Maria by\u0142a, kt\xf3ra pomaza\u0142a Pana olejkiem, i otar\u0142a nogi jego w\u0142osami swemi; kt\xf3rej brat \u0141azarz chorowa\u0142.)",strong:[{text:"cette",strong:"G3778",start:8,end:13},{text:"Seigneur",strong:"G2962",start:44,end:52},{text:"avec",strong:"G1848",start:81,end:85},{text:"malade",strong:"G772",start:137,end:143}]},{number:3,text:"Tedy pos\u0142a\u0142y siostry do niego, m\xf3wi\u0105c: Panie! oto ten, kt\xf3rego mi\u0142ujesz, choruje.",strong:[{text:"dire",strong:"H559",start:21,end:25},{text:"Seigneur",strong:"G2962",start:35,end:43},{text:"malade",strong:"G772",start:75,end:81}]},{number:4,text:"A us\u0142yszawszy to Jezus, rzek\u0142: Ta choroba nie jest na \u015bmier\u0107, ale dla chwa\u0142y Bo\u017cej, aby by\u0142 uwielbion Syn Bo\u017cy przez ni\u0119.",strong:[{text:"avoir",strong:"G1372",start:6,end:11},{text:"Cette",strong:"G3778",start:37,end:42},{text:"mort",strong:"H6757",start:68,end:72},{text:"Dieu",strong:"G2316",start:106,end:110},{text:"Fils",strong:"G5207",start:124,end:128},{text:"Dieu",strong:"G2316",start:132,end:136}]},{number:5,text:"A mi\u0142owa\u0142 Jezus Mart\u0119 i siostr\u0119 jej, i \u0141azarza.",strong:[]},{number:6,text:"A gdy us\u0142ysza\u0142, i\u017c choruje, tedy jeszcze zosta\u0142 na onemmiejscu przez dwa dni.",strong:[{text:"malade",strong:"G772",start:44,end:50},{text:"deux",strong:"G1417",start:61,end:65},{text:"dans",strong:"H6887",start:79,end:83}]},{number:7,text:"Potem rzek\u0142 uczniom: P\xf3jd\u017amy zasi\u0119 do \u017bydowskiej ziemi.",strong:[]},{number:8,text:"Rzekli mu uczniowie: Mistrzu! teraz ci\u0119 szukali \u017bydowie kamionowa\u0107, a ty tam zasi\u0119 idziesz?",strong:[{text:"tout",strong:"G3956",start:43,end:47}]},{number:9,text:"Odpowiedzia\u0142 Jezus: Aza\u017c nie dwana\u015bcie godzin jest za dnia? Je\u017ali kto chodzi we dnie, nie obrazi si\u0119, bo \u015bwiat\u0142o\u015b\u0107 tego \u015bwiata widzi.",strong:[{text:"jour",strong:"H3117",start:47,end:51},{text:"jour",strong:"H3117",start:84,end:88},{text:"monde",strong:"G2889",start:145,end:150}]},{number:10,text:"Ale je\u017ali kto chodzi w nocy, obrazi si\u0119, przeto \u017ce \u015bwiat\u0142o\u015bci w nim nie masz.",strong:[{text:"nuit",strong:"G3571",start:37,end:41}]},{number:11,text:"To powiedzia\u0142, a potem rzek\u0142 im: \u0141azarz, przyjaciel nasz, zasn\u0105\u0142; ale id\u0119, abym go ze snu obudzi\u0142.",strong:[]},{number:12,text:"Tedy rzekli uczniowie jego: Panie! je\u017ali zasn\u0105\u0142, b\u0119dzie zdr\xf3w.",strong:[{text:"Seigneur",strong:"G2962",start:26,end:34}]},{number:13,text:"Ale Jezus m\xf3wi\u0142 o \u015bmierci jego; lecz oni rozumieli, \u017ce o \u015bnie snu powiedzia\u0142.",strong:[{text:"mort",strong:"H6757",start:24,end:28}]},{number:14,text:"Tedy im Jezus powiedzia\u0142 jawnie: \u0141azarz umar\u0142.",strong:[{text:"mort",strong:"H6757",start:45,end:49}]},{number:15,text:"A raduj\u0119 si\u0119 dla was, (\u017cem tam nie by\u0142,) aby\u015bcie uwierzyli; ale id\u017amy do niego.",strong:[]},{number:16,text:"Tedy rzek\u0142 Tomasz, kt\xf3ry s\u0142owi\u0105 Didymus, do sp\xf3\u0142uczni\xf3w: P\xf3jd\u017amy i my, aby\u015bmy i my z nim pomarli.",strong:[{text:"Thomas",strong:"G2381",start:9,end:15},{text:"avec",strong:"G1848",start:87,end:91}]},{number:17,text:"A tak przyszed\u0142 Jezus, i znalaz\u0142, \u017ce ju\u017c cztery dni w grobie by\u0142.",strong:[{text:"dans",strong:"H6887",start:70,end:74}]},{number:18,text:"(A by\u0142o Betania blisko Jeruzalemu jakoby pi\u0119tna\u015bcie stajan.)",strong:[{text:"comme",strong:"G2531",start:4,end:9}]},{number:19,text:"A z \u017byd\xf3w wiele by\u0142o przysz\u0142o do Marty i do Maryi, aby je cieszyli o bracie ich.",strong:[{text:"beaucoup",strong:"G4183",start:0,end:8},{text:"mort",strong:"H6757",start:78,end:82}]},{number:20,text:"Marta tedy, gdy us\u0142ysza\u0142a, \u017ce Jezus idzie, wybie\u017ca\u0142a przeciw niemu; a Maria w domu siedzia\u0142a.",strong:[{text:"maison",strong:"G3609",start:109,end:115}]},{number:21,text:"Tedy rzek\u0142a Marta do Jezusa: Panie! by\u015b tu by\u0142, nie by\u0142by by\u0142 pomar\u0142 brat m\xf3j.",strong:[{text:"Seigneur",strong:"G2962",start:20,end:28},{text:"mort",strong:"H6757",start:76,end:80}]},{number:22,text:"Ale i teraz wiem, \u017ce czegokolwiek by\u015b prosi\u0142 Boga, da ci B\xf3g.",strong:[{text:"tout",strong:"G3956",start:35,end:39},{text:"Dieu",strong:"G2316",start:63,end:67},{text:"Dieu",strong:"G2316",start:69,end:73}]},{number:23,text:"Rzek\u0142 jej Jezus: Zmartwychwstanie brat tw\xf3j.",strong:[]},{number:24,text:"Rzek\u0142a mu Marta: Wiem, \u017ce zmartwychwstanie w zmartwychwstaniu w on ostateczny dzie\u0144.",strong:[{text:"jour",strong:"H3117",start:79,end:83}]},{number:25,text:"Rzek\u0142 jej Jezus: Jam jest zmartwychwstanie i \u017cywot; kto wierzy we mnie, cho\u0107by i umar\u0142, \u017cy\u0107 b\u0119dzie.",strong:[{text:"mort",strong:"H6757",start:101,end:105}]},{number:26,text:"A wszelki, kt\xf3ry \u017cyje, a wierzy we mnie, nie umrze na wieki. Wierzysz\u017ce temu?",strong:[]},{number:27,text:"Rzek\u0142a mu: Tak, Panie! ja uwierzy\u0142am, \u017ce\u015b ty jest Chrystus, Syn Bo\u017cy, kt\xf3ry mia\u0142 przyj\u015b\u0107 na \u015bwiat.",strong:[{text:"Seigneur",strong:"G2962",start:19,end:27},{text:"Christ",strong:"G5547",start:51,end:57},{text:"Fils",strong:"G5207",start:62,end:66},{text:"Dieu",strong:"G2316",start:70,end:74},{text:"dans",strong:"H6887",start:93,end:97},{text:"monde",strong:"G2889",start:101,end:106}]},{number:28,text:"A to powiedziawszy, odesz\u0142a, i zawo\u0142a\u0142a Maryi, siostry swojej, potajemnie, m\xf3wi\u0105c: Mistrz przyszed\u0142, a wo\u0142a ci\u0119.",strong:[]},{number:29,text:"Ona gdy us\u0142ysza\u0142a, wsta\u0142a rych\u0142o, i sz\u0142a do niego.",strong:[]},{number:30,text:"(A jeszcze by\u0142 nie przyszed\u0142 Jezus do miasteczka, ale by\u0142 na onemmiejscu, gdzie go zasz\u0142a Marta.)",strong:[{text:"dans",strong:"H6887",start:35,end:39},{text:"dans",strong:"H6887",start:66,end:70}]},{number:31,text:"Tedy \u017bydowie, kt\xf3rzy z ni\u0105 byli w domu, a cieszyli j\u0105, ujrzawszy Maryj\u0105, \u017ce pr\u0119dko wsta\u0142a i wysz\u0142a, szli za ni\u0105, m\xf3wi\u0105c: Idzie do grobu, aby tam p\u0142aka\u0142a.",strong:[{text:"avec",strong:"G1848",start:22,end:26},{text:"dans",strong:"H6887",start:33,end:37},{text:"maison",strong:"G3609",start:41,end:47}]},{number:32,text:"Maryja tedy, gdy przysz\u0142a, k\u0119dy by\u0142 Jezus, ujrzawszy go, upad\u0142a do n\xf3g jego, m\xf3wi\u0105c mu: Panie! by\u015b tu by\u0142, nie by\u0142by by\u0142 pomar\u0142 brat m\xf3j.",strong:[{text:"Seigneur",strong:"G2962",start:100,end:108},{text:"mort",strong:"H6757",start:156,end:160}]},{number:33,text:"A Jezus, gdy j\u0105 ujrza\u0142 p\u0142acz\u0105c\u0105, i \u017bydy, kt\xf3rzy z ni\u0105 byli przyszli, p\u0142acz\u0105ce, zasmuci\u0142 si\u0119 w duchu, i zk\u0142opota\u0142 si\u0119.",strong:[{text:"avec",strong:"G1848",start:62,end:66},{text:"esprit",strong:"G4151",start:87,end:93},{text:"tout",strong:"G3956",start:102,end:106}]},{number:34,text:"I rzek\u0142: Gdzie\u017c go po\u0142o\u017cyli\u015bcie? Rzekli mu: Panie! p\xf3jd\u017a, a obacz.",strong:[{text:"Seigneur",strong:"G2962",start:31,end:39}]},{number:35,text:"I zap\u0142aka\u0142 Jezus.",strong:[]},{number:36,text:"Tedy m\xf3wili \u017bydowie: Oto jako\u017c go mi\u0142owa\u0142!",strong:[{text:"comme",strong:"G2531",start:33,end:38}]},{number:37,text:"A niekt\xf3rzy z nich rzekli: Nie m\xf3g\u0142\u017ce ten, kt\xf3ry otworzy\u0142 oczy \u015blepego, sprawi\u0107, aby i ten nie umar\u0142?",strong:[{text:"faire",strong:"G1080",start:94,end:99},{text:"homme",strong:"G444",start:114,end:119}]},{number:38,text:"Tedy Jezus zasi\u0119 sam w sobie smuc\u0105c si\u0119, przyszed\u0142 do grobu. A by\u0142 to piec, a kamie\u0144 by\u0142 na\u0144 w\u0142o\u017cony.",strong:[{text:"nouveau",strong:"G2537",start:20,end:27}]},{number:39,text:"Rzek\u0142 Jezus: Odejmijcie kamie\u0144. Rzek\u0142a mu Marta, siostra onego, kt\xf3ry umar\u0142: Panie! ju\u017c cuchnie; bo czwarty dzie\u0144.",strong:[{text:"mort",strong:"H6757",start:46,end:50},{text:"Seigneur",strong:"G2962",start:61,end:69}]},{number:40,text:"Rzek\u0142 jej Jezus: Aza\u017cem ci nie powiedzia\u0142, \u017ce je\u017ali uwierzysz, ujrzysz chwa\u0142\u0119 Bo\u017c\u0105?",strong:[{text:"Dieu",strong:"G2316",start:75,end:79}]},{number:41,text:"I odnie\u015bli kamie\u0144, gdzie by\u0142 umar\u0142y po\u0142o\u017con. A Jezus podni\xf3s\u0142 oczy w g\xf3r\u0119, i rzek\u0142: Ojcze! dzi\u0119kuj\u0119 ci, \u017ce\u015b mi\u0119 wys\u0142ucha\u0142.",strong:[]},{number:42,text:"A jam wiedzia\u0142, \u017ce mi\u0119 zawsze s\u0142uchasz; alem to powiedzia\u0142 dla ludu, kt\xf3ry oko\u0142o stoi, aby uwierzyli, \u017ce\u015b ty mi\u0119 pos\u0142a\u0142.",strong:[{text:"toujours",strong:"H5769",start:37,end:45},{text:"foule",strong:"G3793",start:77,end:82}]},{number:43,text:"A to powiedziawszy, g\u0142osem wielkim zawo\u0142a\u0142: \u0141azarzu! p\xf3jd\u017a precz.",strong:[]},{number:44,text:"I wyszed\u0142 on, co by\u0142 umar\u0142, maj\u0105c zwi\u0105zane r\u0119ce i nogi opo\u0144czami, a twarz jego chust\u0105 by\u0142a obwi\u0105zana. Rzek\u0142 im Jezus: Rozwi\u0105\u017ccie go, a pu\u015b\u0107cie, aby szed\u0142.",strong:[{text:"mort",strong:"H6757",start:6,end:10},{text:"aller",strong:"G4198",start:134,end:139}]},{number:45,text:"Tedy wiele z \u017byd\xf3w, kt\xf3rzy byli przyszli do Maryi, i widzieli, co uczyni\u0142 Jezus, uwierzyli we\u0144.",strong:[]},{number:46,text:"Ale niekt\xf3rzy z nich odeszli do Faryzeusz\xf3w, i powiedzieli im, co uczyni\u0142 Jezus.",strong:[]},{number:47,text:"Tedy zgromadzili przedniejszy kap\u0142ani i Faryzeuszowie rad\u0119, i m\xf3wili: C\xf3\u017c czynimy? bo ten cz\u0142owiek wiele znak\xf3w czyni.",strong:[{text:"homme",strong:"G444",start:117,end:122},{text:"beaucoup",strong:"G4183",start:128,end:136}]},{number:48,text:"Je\u017ali go tak zaniechamy, wszyscy we\u0144 uwierz\u0105, i przyjd\u0105 Rzymianie, a wezm\u0105 i miejsce nasze, i nar\xf3d.",strong:[{text:"faire",strong:"G1080",start:20,end:25},{text:"nation",strong:"G1484",start:107,end:113}]},{number:49,text:"A jeden z nich, Kaifasz, b\u0119d\u0105c najwy\u017cszym kap\u0142anem roku onego, rzek\u0142 im: Wy nic nie wiecie;",strong:[{text:"cette",strong:"G3778",start:54,end:59},{text:"rien",strong:"G3762",start:98,end:102}]},{number:50,text:"Ani my\u015blicie, \u017ce nam jest po\u017cyteczno, aby jeden cz\u0142owiek umar\u0142 za lud, a nie wszystek nar\xf3d zgin\u0105\u0142.",strong:[{text:"dans",strong:"H6887",start:35,end:39},{text:"seul",strong:"G3439",start:60,end:64},{text:"homme",strong:"G444",start:65,end:70},{text:"peuple",strong:"G1484",start:85,end:91},{text:"nation",strong:"G1484",start:103,end:109}]},{number:51,text:"A tego nie m\xf3wi\u0142 sam od siebie, ale b\u0119d\u0105c najwy\u017cszym kap\u0142anem roku onego, prorokowa\u0142, \u017ce mia\u0142 Jezus umrze\u0107 za nar\xf3d;",strong:[{text:"cette",strong:"G3778",start:71,end:76},{text:"nation",strong:"G1484",start:133,end:139}]},{number:52,text:"A nie tylko za nar\xf3d, ale aby i syn\xf3w Bo\u017cych rozproszonych zgromadzi\u0142 w jedno.",strong:[{text:"nation",strong:"G1484",start:26,end:32},{text:"seul",strong:"G3439",start:79,end:83},{text:"corps",strong:"G4561",start:84,end:89},{text:"Dieu",strong:"G2316",start:105,end:109}]},{number:53,text:"A tak od onego dnia radzili o tem, jakoby go zabili.",strong:[{text:"jour",strong:"H3117",start:7,end:11},{text:"faire",strong:"G1080",start:34,end:39}]},{number:54,text:"Przeto\u017c Jezus nie chodzi\u0142 wi\u0119cej jawnie mi\u0119dzy \u017bydami, ale odszed\u0142 stamt\u0105d do krainy le\u017c\u0105cej przy puszczy, do miasta, kt\xf3re zowi\u0105 Efraim, i tam mieszka\u0142 z uczniami swymi.",strong:[{text:"dans",strong:"H6887",start:86,end:90},{text:"dans",strong:"H6887",start:121,end:125},{text:"avec",strong:"G1848",start:172,end:176}]},{number:55,text:"A by\u0142a blisko wielkanoc \u017bydowska; i wiele ich wysz\u0142o z onej krainy do Jeruzalemu przed wielkanoc\u0105, aby si\u0119 oczy\u015bcili.",strong:[{text:"beaucoup",strong:"G4183",start:36,end:44},{text:"pays",strong:"H776",start:56,end:60}]},{number:56,text:"Tedy szukali Jezusa, i m\xf3wili mi\u0119dzy sob\u0105, stoj\u0105c w ko\u015bciele: C\xf3\u017c si\u0119 wam widzi? \u017ce nie przyjdzie na \u015bwi\u0119to?",strong:[{text:"dans",strong:"H6887",start:61,end:65}]},{number:57,text:"A dali byli rozkazanie przedniejszy kap\u0142ani i Faryzeuszowie, je\u017aliby kto pozna\u0142, gdzie by by\u0142, aby oznajmi\u0142, \u017ceby go pojmali.",strong:[{text:"ordre",strong:"G1785",start:68,end:73}]}]},a=n}}]);
